import React from "react";

function Card(simpsons) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt={simpsons.name} src={simpsons.image} />
      </div>
      <div className="content">
        <ul>
          <li>{simpsons.name}</li>
        </ul>
      </div>
      <span
        onClick={() => simpsons.removeSimpson(simpsons.id)}
        className="remove"
      >
        X
      </span>
    </div>
  );
}

export default Card;
